import heapq

def smallestDistancePair(nums, k):
    """
    :type nums: List[int]
    :type k: int
    :rtype: int
    """
    arrLength = len(nums)
    nums = sorted(nums)
    lo, hi = 0, nums[-1] - nums[0]
    arrLength = len(nums)
    while lo < hi:
        count = 0
        mid = (lo + hi) // 2
        j = 0
        for i in xrange(arrLength):
            while j < arrLength and nums[j] - nums[i] <= mid:
                j+=1
            count += (j - i - 1)
        if count >= k:
            hi = mid
        else:
            lo = mid + 1
    return lo

